import React from "react";
import HomeInteriorSlider from "./HomeInteriorSlider";
import MeetingRoomIcon from "@material-ui/icons/MeetingRoom";
import DirectionsCarIcon from "@material-ui/icons/DirectionsCar";
import CheckIcon from "@material-ui/icons/Check";
import EventNoteIcon from "@material-ui/icons/EventNote";
import AccessibleForwardOutlinedIcon from "@material-ui/icons/AccessibleForwardOutlined";
import PropertyViewAgent from "./PropertyViewAgent";
import VPForm from "./VPForm";
import CardSingle from "./CardSingle";
import house1 from "./img/house1.jpg";
import house2 from "./img/house2.jpg";
import house3 from "./img/house3.jpg";
import house4 from "./img/house4.jpg";
import house5 from "./img/house5.jpg";
import house6 from "./img/house6.jpg";
import house7 from "./img/house7.jpg";
import house8 from "./img/house8.jpg";
import house9 from "./img/house9.jpg";
import house10 from "./img/house10.jpg";
import house11 from "./img/house11.jpg";
import house12 from "./img/house12.jpg";
import house13 from "./img/house13.jpg";
import house14 from "./img/house14.jpg";
import house15 from "./img/house15.jpg";
import house16 from "./img/house16.jpg";
import SidebarCards from "./SidebarCards";
import LandingPageSingleCard from "./LandingPageSingleCard";
import TestCarousel from "./TestCarousel";
import FeaturedListings from "./FeaturedListings";
import Footer from "./Footer";
import MortgageCalculator from "@herilsaha/mortgage-calculator";
import "./Calculator.css";
import PagesHero from "./PagesHero";
import "./AllProperties.css";
import AllAgentsSidebar from "./AllAgentsSidebar";
import agent1 from "./img/agent1.jpg";
import agent3 from "./img/agent3.jpg";
import agent4 from "./img/agent4.jpg";

function AllProperties(props) {
  const card1template = {
    cardImg: house8,
    agentImg: agent4,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$1,100,000",
    bedrooms: "2",
    bathrooms: "4",
    sqft: "4,900 SqFt",
  };

  const card2template = {
    cardImg: house9,
    agentImg: agent4,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$680,000",
    bedrooms: "2",
    bathrooms: "4",
    sqft: "3,200 SqFt",
  };

  const card3template = {
    cardImg: house6,
    agentImg: agent4,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$425,000",
    bedrooms: "2",
    bathrooms: "2",
    sqft: "2,300 SqFt",
  };
  const card4template = {
    cardImg: house12,
    agentImg: agent4,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$499,999",
    bedrooms: "2",
    bathrooms: "3",
    sqft: "2,850 SqFt",
  };
  const card5template = {
    cardImg: house14,
    agentImg: agent4,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$4,100,000",
    bedrooms: "4",
    bathrooms: "5",
    sqft: "5,000 SqFt",
  };
  const card6template = {
    cardImg: house15,
    agentImg: agent3,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$5,700,000",
    bedrooms: "4",
    bathrooms: "5",
    sqft: "7,200 SqFt",
  };

  const card7template = {
    cardImg: house10,
    agentImg: agent3,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$5,400,000",
    bedrooms: "4",
    bathrooms: "5",
    sqft: "7,200 SqFt",
  };

  const card8template = {
    cardImg: house7,
    agentImg: agent3,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$14,000,000",
    bedrooms: "6",
    bathrooms: "7",
    sqft: "13,500 SqFt",
  };
  const card9template = {
    

    cardImg: house16,
    agentImg: agent3,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$4,300,000",
    bedrooms: "3",
    bathrooms: "4",
    sqft: "5,200 SqFt",
  };
  const card10template = {
    cardImg: house11,
    agentImg: agent3,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$630,000",
    bedrooms: "3",
    bathrooms: "4",
    sqft: "3,900 SqFt",
  };
  return (
    <div>
      <PagesHero />
      <div className="all_properties">
        <div className="all_properties_flex">
          <div className="ap_left">
            <CardSingle
              cardImg={house1}
              agentImg={agent1}
              cardTitle="Mansion on Lorem Ave"
              address="555 Lorem Avenue, Miami, FL 12345, USA"
              cardPrice="$5,200,000"
              bedrooms="4"
              bathrooms="5"
              sqft="6,500 SqFt"
            />
            <CardSingle
              cardImg={house2}
              agentImg={agent1}
              cardTitle="Mansion on Lorem Ave"
              address="555 Lorem Avenue, Miami, FL 12345, USA"
              cardPrice="$1,800,000"
              bedrooms="3"
              bathrooms="4"
              sqft="4500 SqFt"
            />
            <CardSingle
              cardImg={house3}
              agentImg={agent1}
              cardTitle="Mansion on Lorem Ave"
              address="555 Lorem Avenue, Miami, FL 12345, USA"
              cardPrice="$2,300,000"
              bedrooms="4"
              bathrooms="5"
              sqft="5000 SqFt"
            />
            <CardSingle
              cardImg={house4}
              agentImg={agent1}
              cardTitle="Mansion on Lorem Ave"
              address="555 Lorem Avenue, Miami, FL 12345, USA"
              cardPrice="$900,000"
              bedrooms="2"
              bathrooms="3"
              sqft="2750 SqFt"
            />
            <CardSingle
              cardImg={house5}
              agentImg={agent1}
              cardTitle="Villa on Lorem Street"
              address="555 Lorem Avenue, Miami, FL 12345, USA"
              cardPrice="$650,000"
              bedrooms="2"
              bathrooms="3"
              sqft="2300 SqFt"
            />
            <CardSingle card1template={card1template}/>
            <CardSingle card2template={card2template}/>
            <CardSingle card3template={card3template}/>
            <CardSingle card4template={card4template}/>
            <CardSingle card5template={card5template}/>
            <CardSingle card6template={card6template}/>
            <CardSingle card7template={card7template}/>
            <CardSingle card8template={card8template}/>
            <CardSingle card9template={card9template}/>
            <CardSingle card10template={card10template}/>
          </div>
          <div className="ap_sidebar">
            <div className="ap_sidebar_item">
              <h3>Our Agents</h3>
              <AllAgentsSidebar
                agentSBImg={agent1}
                agentSBName="John Ryan"
                agentSBPhone="(123)-456-1235"
              />
            </div>
            <div className="ap_sidebar_item">
              <FeaturedListings />
            </div>
            <div className="ap_sidebar_item">
              <MortgageCalculator />
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default AllProperties;
